import React, { Component } from "react";
import "./content.scss";

class Content extends React.Component {
  constructor(props) {
    super(props);
  }
  state = {};
  render() {
    return (
      <div className="content">
        {this.props.data.map((item, idx) => {
          <span key={idx}>
            <title>{item.singer}</title>
            <div>{item.track}</div>
          </span>;
        })}
      </div>
    );
  }
}

export default Content;
